  return (
    <footer className="site-footer">
      <div className="footer-inner container">
        <div className="footer-left">
          <div className="footer-name">GOWTHAM C</div>
          <div className="footer-role">Electronics &amp; Robotics Developer</div>
          <div className="footer-copy">Copyright Â© 2025</div>
        </div>

        <div className="footer-center">
          <a href="mailto:gowtham66247@gmail.com" className="footer-link">gowtham66247@gmail.com</a>
          <a href="tel:+916384744186" className="footer-link">+91 63847 44186</a>
          <div className="footer-location">Coimbatore, India</div>
